INSERT INTO `settings` VALUES (1,'app_maintainance','{\"_token\":\"ZWflBPPgJAZ8YX1KLNWRCbA4qZmiugxzrjDjdMnq\",\"maintain_mode\":\"false\",\"message\":\"we will get back to u soon\"}','2023-09-19 10:40:57','2023-09-19 05:49:48'),(2,'app_version','{\"_token\":\"9UbyStXgZLUHEQMW3jOqWu8DMErftA7tj3OUM0T5\",\"link\":\"https:\\/\\/homerevise.co\\/storage\\/uploads\\/apk\\/homerevise.apk\",\"version\":\"4.2.12\"}','2023-09-19 10:40:57','2023-09-23 13:54:17'),(3,'pages','{\"_token\":\"9UbyStXgZLUHEQMW3jOqWu8DMErftA7tj3OUM0T5\",\"privacy_policy\":\"<p><strong>Privacy Policy:<\\/strong><\\/p>\\r\\n<ol style=\\\"list-style-type: none;\\\">\\r\\n<li>\\r\\n<p><strong>Introduction:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Start with a clear and concise introduction that explains the purpose of the privacy policy.<\\/li>\\r\\n<li>State that this policy applies to all users of the app and that by using the app, users agree to the terms outlined in the policy.<\\/li>\\r\\n<li>Include the effective date of the policy and mention that updates may occur.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Information Collected:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Provide a comprehensive list of the types of information collected, such as:\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>User-provided information (e.g., name, email, username).<\\/li>\\r\\n<li>Automatically collected information (e.g., IP address, device type, browser type).<\\/li>\\r\\n<li>Information collected through cookies and tracking technologies.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>How Information is Used:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Explain in detail how the collected information is used, which may include:\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Creating and managing user accounts.<\\/li>\\r\\n<li>Personalizing content and recommendations.<\\/li>\\r\\n<li>Monitoring app performance and user engagement.<\\/li>\\r\\n<li>Sending notifications, updates, and promotional materials.<\\/li>\\r\\n<li>Improving app features and user experience.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Information Sharing:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Clearly state if and with whom user data is shared, such as:\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Third-party service providers (e.g., hosting, analytics, payment processing).<\\/li>\\r\\n<li>Advertisers and advertising networks.<\\/li>\\r\\n<li>Law enforcement or legal authorities when required.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Security Measures:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Describe the security measures in place to protect user data, including encryption, access controls, and regular security audits.<\\/li>\\r\\n<li>Encourage users to maintain the security of their accounts, such as using strong passwords and enabling two-factor authentication.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>User Rights:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Detail the rights users have regarding their data, including:\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>The right to access their personal information.<\\/li>\\r\\n<li>The right to correct inaccuracies in their data.<\\/li>\\r\\n<li>The right to request the deletion of their data.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>Explain the process for users to exercise these rights, such as contacting your support team.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Cookies and Tracking:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>If applicable, provide information about the use of cookies and tracking technologies.<\\/li>\\r\\n<li>Explain how users can manage cookie settings through their device or browser.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Third-Party Links:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Inform users if your app contains links to third-party websites or services.<\\/li>\\r\\n<li>Clarify that your privacy policy applies only to your app, and users should review the privacy policies of linked websites.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Changes to Privacy Policy:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>State that the privacy policy may be updated from time to time.<\\/li>\\r\\n<li>Explain how users will be notified of significant changes, such as through email or app notifications.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Contact Information:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Provide a dedicated email address or contact form for users to reach out with questions, concerns, or data-related requests.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<\\/ol>\",\"term_condition\":\"<p><strong>Terms and Conditions:<\\/strong><\\/p>\\r\\n<ol style=\\\"list-style-type: none;\\\">\\r\\n<li>\\r\\n<p><strong>Introduction:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Start with a clear introduction that explains the purpose and legal nature of the terms and conditions.<\\/li>\\r\\n<li>State that by using the app, users agree to abide by these terms and conditions.<\\/li>\\r\\n<li>Include the effective date of the terms and mention that updates may occur.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>User Registration:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Explain the process of user registration, including age restrictions and the accuracy of information.<\\/li>\\r\\n<li>Clarify that users are responsible for maintaining the confidentiality of their account credentials.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>User Conduct:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Provide a detailed list of acceptable and unacceptable user behavior on the platform.<\\/li>\\r\\n<li>Emphasize that users must not engage in illegal activities, harass others, or post harmful content.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Intellectual Property:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Declare ownership of all content on the app, including text, images, videos, and user-generated content.<\\/li>\\r\\n<li>Specify the rights and limitations regarding content use, sharing, and copyright infringement.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Payments and Fees:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Explain any fees associated with using the app, including subscription models and payment processes.<\\/li>\\r\\n<li>Detail refund and cancellation policies, if applicable.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Termination:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>State under what circumstances user accounts can be terminated, such as for violations of the terms and conditions.<\\/li>\\r\\n<li>Mention the process for appeals or disputes if users believe their accounts were wrongly terminated.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Disclaimers:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Include disclaimers about the accuracy of information on the app, the availability of content, and third-party content.<\\/li>\\r\\n<li>Advise users to use the app responsibly and acknowledge that they assume certain risks.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Liability:<\\/strong><\\/p>\\r\\n<ul style=\\\"list-style-type: disc;\\\">\\r\\n<li>Limit your liability for certain actions or outcomes, such